import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

import { faCheckSquare, faSquare as farSquare } from '@fortawesome/free-regular-svg-icons'

export default function FilterPanel(props) {
  

  
  
  return (
  <div className="filterPanel marginLT10">
      
      <p>KUKKUUUUU</p>

      <FontAwesomeIcon icon={ farSquare } size="1x" />
      <FontAwesomeIcon icon={ faCheckSquare } size="1x" />
   
  </div>
  )
}
